import { lazy } from "react";

const PagesRoutes = [
  // PAGES

  {
    path: "/pages/maquinas",
    component: lazy(() => import("../../view/pages/maquinas")),
    layout: "VerticalLayout",
  },
  {
    path: "/pages/parametros-padrao",
    component: lazy(() => import("../../view/pages/parametros-padrao")),
    layout: "VerticalLayout",
  },

];

export default PagesRoutes;
